import React from "react";
import { Link } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { setValidatedUser } from '../store/validatedUser'
import axios from 'axios'



const NavBar = () => {

  let validatedUser = useSelector((state) => state)
  const dispath = useDispatch()

  useEffect(() => {
    axios.get('/api/auth')
    .then((res) =>  res.data)
    .then((user) => {if (user) dispatch(setValidatedUser(user))})
    .cath((err) => console.log('An error Ocurred :('))
  }, [])

  console.log('VALIDATED USERRRR', validatedUser)

  return (
    <div>
      <nav className="footerDiv">
        <div className="footerFlexItems">
          <div className="homeAndLoginDiv">
            <Link to="/" className="footerBox">
              Home
            </Link>
            <Link to="/movies" className="footerBox">
              Movies
            </Link>
          </div>
          <div>
            <Link to="/users/login" className="footerBox">
              Log in
            </Link>
            <Link to="/users/register" className="footerBox">
              Register
            </Link>
          </div>
        </div>
      </nav>
    </div>
  );
};

export default NavBar;
